Turismiobjekti kirjeldus:
Obinitsa Puhkemaja asub Setomaa südames, rahulikus ja müravabas keskkonnas. Maja on ideaalne koht laagrite korraldamiseks-majutamiseks, aga ka sobiv koht Setomaad avastavatele turistidele. Obinitsa Puhkemajas pakume:

aastaringselt majutust;
sündmuste korraldamise võimalust koos õhtujuhiga;
puhkemaja kultuuriküüni kasutamise võimalust;
grillimise- ja telkimisevõimalust;
toitlustust.Laagritele ja püsiklientidele hinnasoodustus!

Tule avasta Setomaad!

Vastseliina Metskonna puhkeala on loodusenautlejaile ideaalne koht. Suurel privaatsel alal on võimalik telkida või karavanautoga peatuda. 
Meie juures peatujale on kasutamiseks on kööginurk, WC, välimööbel ja osalejate rohkuse korral ka välitelk.
Kohapeal saate veel:

lõõgastuda aias või minna piknikule;
kasutada grillimisvõimalust, et valmistada maitsev eine värskes õhus;
mängida laste mänguväljakul;
kasutada ühiskööki, et valmistada mugavalt sööki.

Võimalus on korraldada suvist üritust kuni 40-le inimesele.
Tule ja naudi rahulikku puhkust imekaunis looduses.
